import { Button } from "@mui/material"
import classes from './ProjectList.module.css'
import React from "react"
export interface IProps{
    id:string,
    name:string,
    staff:string,
    client:string,
    statusId:boolean

}
const ProjectList : React.FC<{onProps:IProps[]}>=(props)=>{
return (
    <div >
       
    <ul >
    <div >{props.onProps.map((item:any, index)=>{
        
    return  <li className={classes.specificproject} key={index}>
     <div className={classes.allBody}><h2> {`שם:${item.name}`}</h2> <h2> {`מפתח:${item.staff}`}</h2>   <h2> {`לקוח:${item.client}`}</h2> <h2> {`סטטוס:${item.statusId}`}</h2> <Button >לפרוייקט לחץ כאן</Button></div>

</li>
    })}</div>
    </ul>
    </div>
)
}

export default ProjectList
